import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import { useSelector, useDispatch } from 'react-redux';
import { fetchPosts, selectPostsByUser } from '../store/slices/postsSlice';
import api from '../services/api';
import PostCard from '../components/posts/PostCard';
import Sidebar from '../components/layout/Sidebar';
import RightSidebar from '../components/layout/RightSidebar';

const Profile = () => {
    const { id } = useParams();
    const dispatch = useDispatch();
    const [user, setUser] = useState(null);
    const posts = useSelector((state) => selectPostsByUser(state, parseInt(id)));
    const status = useSelector((state) => state.posts.status);

    useEffect(() => {
        const fetchUser = async () => {
            try {
                const response = await api.get(`/users/${id}`);
                setUser(response.data);
            } catch (err) {
                console.error("User not found", err);
            }
        };
        fetchUser();
        if (status === 'idle') {
            dispatch(fetchPosts());
        }
    }, [id, status, dispatch]);

    if (!user) return <p>Loading user profile...</p>;

    return (
        <div className="profile-container">
            <img src="/cover.png" className="cover-img" alt="cover" />

            <div className="profile-details">
                <div className="pd-row">
                    <img src={user.avatar} className="pd-image" alt="user" />
                    <div>
                        <h3>{user.username}</h3>
                        <p>235 Friends - 15 mutual</p>
                        <img src="/Leo.jpg" width="32px" alt="friend" />
                        <img src="/Ney.jpg" width="32px" alt="friend" />
                    </div>
                </div>
                <div className="pd-right">
                    <button type="button"><img src="/add-friends.png" alt="add" /> Friends</button>
                    <button type="button"><img src="/message.png" alt="msg" /> Message</button>
                    <br />
                    <a href="#"><img src="/more.png" alt="more" /></a>
                </div>
            </div>

            <div className="profile-info">
                <div className="info-col">
                    <div className="profile-intro">
                        <h3>Intro</h3>
                        <p className="intro-text">Believe in yourself and you can do anything <img src="/feeling.png" alt="emoji" /></p>
                        <hr />
                        <ul>
                            <li><img src="/profile-job.png" alt="job" /> Went to High School</li>
                            <li><img src="/profile-study.png" alt="study" /> Studied at OFPPT</li>
                            <li><img src="/profile-home.png" alt="home" /> Lives in Casablanca</li>
                            <li><img src="/profile-location.png" alt="location" /> From Casablanca</li>
                        </ul>
                    </div>
                </div>
                <div className="post-col">
                    {posts.map(post => <PostCard key={post.id} post={post} />)}
                </div>
            </div>
        </div>
    );
};

export default Profile;
